from collections import Counter

def model(x, y, data):
    distances = []
    for xi, yi, label in data:
        dist = math.sqrt((x - xi)**2 + (y - yi)**2)
        distances.append((dist, label))

    distances.sort(key=lambda item: item[0])

    k = 3
    if len(distances) < k:
        k = len(distances) # Adjust k if less than k points available

    if k == 0:
         return 0 # Default for no neighbors

    top_k_labels = [label for _, label in distances[:k]]

    label_counts = Counter(top_k_labels)

    # Handle ties: Default ties to 0 for reproducibility.
    if label_counts[1] > label_counts[0]:
        return 1
    elif label_counts[0] > label_counts[1]:
        return 0
    else:
         # Tie-breaking: Default to 0
         return 0

